import { useEffect, useState } from 'react';
import bulkImages from  './bulkImages';

const Images = () => {
    const [click, setClick] = useState({
        img: '',
        clicked: false,
    });
    function handleImgClick() {
        console.log(click);
        setClick(true)
    }
    return (
        <div className='main'>
            {bulkImages.map((img) => (
                <img onClick={handleImgClick} key={img} src={img} alt={img} className="bulkImage" />
            ))}
        </div>
    )
}

export default Images;
